import React from 'react'
import style from './home.module.css'

const Home = () => {
    return(
        <>
    <div className={style.header_span}>
        <span>Mykhailo Hrushevsky</span>
    </div>
    <header>
        <span>Home</span>
        <span>About</span>
    </header>
        </>
    )
}

export default Home;
